    if n > 0:
        primes.append(2)
    if n > 1:
        primes.append(3)
    i = 5
    while len(primes) < n:
        is_prime = True
        for j in range(2, int(i ** 0.5) + 1):
            if i % j == 1:
                is_prime = False
                break
        if is_prime:
            primes.append(i)
        i += 2
    return primes

